// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import {Token} from "./Token.sol";
import {FlashLoanProvider} from "./FlashLoanProvider.sol";

contract Exchange is FlashLoanProvider {
    event TokensDeposited(
        address indexed token,
        address indexed user,
        uint256 amount,
        uint256 balance
    );

    event TokensWithdraw(
        address indexed token,
        address indexed user,
        uint256 amount,
        uint256 balance
    );

    event OrderCreated(
        uint256 id,
        address indexed user,
        address indexed tokenGet,
        uint256 amountGet,
        address indexed tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );

    event OrderCancelled(
        uint256 id,
        address indexed user,
        address indexed tokenGet,
        uint256 amountGet,
        address indexed tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );

    event OrderFilled(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        address creator,
        uint256 timestamp
    );

    address public owner;
    address public feeAccount;
    uint256 public feePercent;

    mapping(address => mapping(address => uint256))
        private userTotalTokenBalance;

    mapping(address => mapping(address => uint256))
        private userActiveTotalBalance;

    struct Order {
        uint256 id;
        address user;
        address tokenGet;
        uint256 amountGet;
        address tokenGive;
        uint256 amountGive;
        uint256 timestamp;
    }

    uint256 public orderCount;
    mapping(uint256 => Order) public orderBook;
    mapping(address => uint256[]) userOrders;
    mapping(uint256 => bool) public isOrderCancelled;
    mapping(uint256 => bool) public isOrderFilled;

    constructor(address _owner, address _feeAccount, uint256 _feePercent) {
        owner = _owner;
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    function totalBalanceOf(
        address _user,
        address _token
    ) public view returns (uint256 amount) {
        return userTotalTokenBalance[_user][_token];
    }

    function activeBalanceOf(
        address _user,
        address _token
    ) public view returns (uint256 activeAmount) {
        return userActiveTotalBalance[_user][_token];
    }

    function depositToken(address _token, uint256 _amount) public {
        Token token = Token(_token);
        userTotalTokenBalance[msg.sender][_token] += _amount;

        emit TokensDeposited(
            _token,
            msg.sender,
            _amount,
            userTotalTokenBalance[msg.sender][_token]
        );

        require(
            token.transferFrom(msg.sender, address(this), _amount),
            "Exchange: Token transfer failed."
        );
    }

    function withdrawToken(address _token, uint _amount) public {
        require(
            totalBalanceOf(msg.sender, _token) -
                activeBalanceOf(_token, msg.sender) >=
                _amount,
            "Exchange: Insufficient token balance."
        );

        userTotalTokenBalance[msg.sender][_token] -= _amount;
        emit TokensWithdraw(
            _token,
            msg.sender,
            _amount,
            userTotalTokenBalance[msg.sender][_token]
        );

        Token token = Token(_token);
        require(
            token.transfer(msg.sender, _amount),
            "Exchange: Token transfer failed."
        );
    }

    //Make & Cancel Orders
    function makeOrder(
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) public {
        require(
            totalBalanceOf(msg.sender, _tokenGive) >=
                activeBalanceOf(msg.sender, _tokenGive) + _amountGive,
            "Exchange: Insufficient token balance."
        );

        orderCount += 1;
        orderBook[orderCount] = Order(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );

        userActiveTotalBalance[msg.sender][_tokenGive] += _amountGive;

        emit OrderCreated(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );
    }

    function cancelOrder(uint256 _id) public {
        Order storage order = orderBook[_id];
        require(order.id == _id, "Exchange: Order does not exists.");
        require(
            order.user == msg.sender,
            "Exchange: Not the owner of the order."
        );
        require(
            isOrderCancelled[_id] == false,
            "Exchange: Order already cancelled."
        );

        isOrderCancelled[_id] = true;
        userActiveTotalBalance[msg.sender][order.tokenGive] -= order.amountGive;

        emit OrderCancelled(
            orderCount,
            msg.sender,
            order.tokenGet,
            order.amountGet,
            order.tokenGive,
            order.amountGive,
            block.timestamp
        );
    }

    function fillOrder(uint256 _id) public {
        Order storage order = orderBook[_id];
        require(order.id == _id, "Exchange: Order does not exists.");
        require(
            isOrderCancelled[_id] == false,
            "Exchange: Order is cancelled."
        );
        require(
            order.user != msg.sender,
            "Exchange: Order creator is not allowed to fill it."
        );
        require(
            isOrderFilled[_id] == false,
            "Exchange: Order is already filled."
        );

        _trade(
            _id,
            order.user,
            order.tokenGet,
            order.amountGet,
            order.tokenGive,
            order.amountGive
        );

        isOrderFilled[_id] = true;
    }

    function _trade(
        uint256 _orderId,
        address _user,
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) internal {
        //Swap Balance
        require(
            userTotalTokenBalance[msg.sender][_tokenGet] -
                userActiveTotalBalance[msg.sender][_tokenGet] >=
                _amountGet,
            "Exchange: Insufficient tokenGet balance."
        );

        uint256 _feeAmount = (_amountGet * feePercent) / 100;
        userTotalTokenBalance[msg.sender][_tokenGet] -= _amountGet + _feeAmount;
        userTotalTokenBalance[msg.sender][_tokenGive] += _amountGive;

        userActiveTotalBalance[_user][_tokenGive] -= _amountGive;
        userTotalTokenBalance[_user][_tokenGive] -= _amountGive;
        userTotalTokenBalance[_user][_tokenGet] += _amountGet;

        userTotalTokenBalance[feeAccount][_tokenGet] += _feeAmount;

        emit OrderFilled(
            _orderId,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            _user,
            block.timestamp
        );
    }
}

contracts/FlashLoanProvider.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;
import {Token} from "./Token.sol";

interface IFlashLoanReceiver {
    function receiveFlashLoan(
        address token,
        uint256 amount,
        bytes memory data
    ) external;
}

abstract contract FlashLoanProvider {
    event FlashLoan(address token, uint256 amount, uint256 timestamp);
    function flashLoan(
        address _token,
        uint256 _amount,
        bytes memory _data
    ) public {
        Token token = Token(_token);
        require(
            token.balanceOf(address(this)) >= _amount,
            "FlashLoanProvider: Insufficient funds to loan."
        );

        require(
            token.transfer(msg.sender, _amount),
            "FlashLoanProvider: Transfer failed."
        );

        IFlashLoanReceiver(msg.sender).receiveFlashLoan(_token, _amount, _data);

        emit FlashLoan(_token, _amount, block.timestamp);
    }
}

